CREATE TABLE m_live_difficulty_note_gimmick(
  live_difficulty_id INTEGER NOT NULL,
  note_id INTEGER NOT NULL,
  note_gimmick_type INTEGER NOT NULL,
  note_gimmick_icon_type INTEGER NOT NULL,
  skill_master_id INTEGER NOT NULL,
  name TEXT NOT NULL,
  description TEXT NOT NULL,
  PRIMARY KEY (live_difficulty_id, note_id),
  FOREIGN KEY (live_difficulty_id) REFERENCES m_live_difficulty(live_difficulty_id),
  FOREIGN KEY (skill_master_id) REFERENCES m_skill(id)
);
